import Router from '../../router';
import Cronoanalise from './cronoanalise.service';
import {mdiAccount, mdiMagnify, mdiFileDocumentBoxSearch} from '@mdi/js'

export default {
    name: "Cronoanalises",
    Router,
    data: () => ({
        icons: {
            mdiAccount,
            mdiMagnify,
            mdiFileDocumentBoxSearch
        },
        msgDeAlertas: {
            success: '',
            error: '',
            info: '',
            warning: '',
        },
        cronoanalises: [],
        loading: false,
        pesquisaRapida: '',
        headers: [
            {
                text: 'Código',
                align: 'left',
                value: 'produto.codigo'
            },
            {
                text: 'Nome Produto',
                align: 'left',
                value: 'produto.nome',
            },
            {
                text: 'Empresa',
                align: 'left',
                value: 'produto.empresa.nome',
            },
            {
                text: 'Cronoanalista',
                align: 'left',
                value: 'cronoanalista',
            },
            {
                text: 'Observações',
                align: 'center',
                value: 'produto.quantidadeObservacoes',
            },
            {
                text: 'Data Criação',
                align: 'center',
                value: 'dataCriacao'
            },
            {
                text: 'Detalhar',
                value: 'detalhar',
                align: 'center',
                sortable: false
            },
        ],
    }),
    created() {
        this.initialize()
    },
    methods: {
        initialize() {
            this.loading = true;
            Cronoanalise.listar().then(resposta => {
                this.loading = false;
                this.cronoanalises = resposta.data;
            }).catch(onError => {
                if (onError.response && onError.response.data) {
                    this.onError(onError.response.data.message);
                } else {
                    this.onError(onError);
                }
                this.loading = false;
            });
        },
        detalharCronoanalise(item) {
            if (item && item.oid) {
                Cronoanalise.detalharCronoanalise(item.oid).then().catch(onError => {
                    if (onError.response && onError.response.data) {
                        this.onError(onError.response.data.message);
                    } else {
                        this.onError(onError);
                    }
                });
                this.$router.push({path: `/detalhar-cronoanalise/${item.oid}`});
            }
        },
        close() {
            setTimeout(() => {
                this.initialize();
            }, 300);
        },
        onSuccess(msg) {
            this.$swal.fire({
                position: 'top',
                type: 'success',
                title: 'Sucesso',
                text: msg,
                showConfirmButton: false,
                timer: 2000
            });
        },
        onError(msg) {
            this.$swal.fire({
                position: 'top',
                type: 'error',
                title: 'Erro',
                text: msg,
                timer: 2000,
            })
        },
    },
    components: {},
}
